-- media 

-- обновляем id в media
UPDATE IGNORE media 
SET
user_id = FLOOR(1 + (RAND() * 100));

-- дорабатываем колонку metadata
UPDATE media SET metadata = CONCAT(
  '{"', 
  'owner', 
  '":"', 
  (SELECT CONCAT(first_name, ' ', last_name) FROM users WHERE id = user_id),
   '"}');

